package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;import java.util.Date;/** * 天贝存储 */@TableName("tianbei_base")public class TianbeiBase implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long userId;	private Integer type;	private String dataOne;	private String dataTwo;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date createTime;	@JsonFormat(pattern = "yyyy-MM-dd HH:mm:ss",timezone = "GMT+8")	private Date updateTime;	private Integer status;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Integer getType() {		return type;	}	public void setType(Integer type) {		this.type = type;	}	public String getDataOne() {		return dataOne;	}	public void setDataOne(String dataOne) {		this.dataOne = dataOne;	}	public String getDataTwo() {		return dataTwo;	}	public void setDataTwo(String dataTwo) {		this.dataTwo = dataTwo;	}	public Date getCreateTime() {		return createTime;	}	public void setCreateTime(Date createTime) {		this.createTime = createTime;	}	public Date getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}}